import { BsArrowUpRight } from 'react-icons/bs';
 
import { motion } from 'framer-motion';

import { fadeIn } from '../variants'


const services = [
  {
    name: 'UI/UX Design',
    description: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Numquam debitis ea voluptatum aperiam pariatur explicabo maiores nobis quia consequatur qui',
    link: 'Learn more'
  }
]

const Services = () => {
  return <div id='services' className='section'>
    Services
    </div>;
};

export default Services;
